Patch Set 1:

> Patch Set 1:
> 
> Note that the above mentioned line is wrapped with StartAllAction() / EndAllAction(). That also means that you need to add your SetContinuousEndnotes() not to SwViewShell (as the name suggests that is only for viewing the document, not editing it) but to e.g. SwWrtShell. The only place where you call SetContinuousEndnotes() is already an SwWrtShell anyway.

I'm not sure I understood this correctly, but I tried to move it from sw/source/core/view/viewsh.cxx like this, but still nothing happens at runtime:

diff --git a/sw/source/uibase/inc/wrtsh.hxx b/sw/source/uibase/inc/wrtsh.hxx
index 727d4cfb64c9..371463767ea5 100644
--- a/sw/source/uibase/inc/wrtsh.hxx
+++ b/sw/source/uibase/inc/wrtsh.hxx
@@ -498,6 +498,7 @@ typedef bool (SwWrtShell::*FNSimpleMove)();
     void MakeAllFoldedOutlineContentVisible(bool bMakeVisible = true);
     void InvalidateOutlineContentVisibility();
     bool GetAttrOutlineContentVisible(const size_t nPos);
+    void SetContinuousEndnotes(bool bContinuousEndnotes);

 private:

diff --git a/sw/source/uibase/wrtsh/wrtsh1.cxx b/sw/source/uibase/wrtsh/wrtsh1.cxx
index 3be1be85b1f3..8db0304da3af 100644
--- a/sw/source/uibase/wrtsh/wrtsh1.cxx
+++ b/sw/source/uibase/wrtsh/wrtsh1.cxx
@@ -2277,4 +2277,13 @@ bool SwWrtShell::GetAttrOutlineContentVisible(const size_t nPos)
     return bVisibleAttr;
 }

+void SwWrtShell::SetContinuousEndnotes(bool bSetContinuousEndnotes)
+{
+    StartAllAction();
+    IDocumentSettingAccess& rIDSA = getIDocumentSettingAccess();
+    rIDSA.set(DocumentSettingId::CONTINUOUS_ENDNOTES, bSetContinuousEndnotes);
+    InvalidateLayout(true);
+    EndAllAction();
+}
+

Is it possible that the layout code is not prepared to handle changes in the value of bSetContinuousEndnotes? Or just ~this part needs some more magic that is beyond me?
